// SPDX-License-Identifier: GPL-3.0
pragma solidity >=0.7.0 <0.9.0;

contract SupplyChain {
    struct Step {
        Status status;
        string metadata;
    }

    enum Status {
        CREATED,
        READY_FOR_PICK_UP,
        PICKED_UP,
        READY_FOR_DELIVERY,
        DELIVERED
    }

    event RegisteredStep( //nos v a informar cada vez que se agregue un paso a un producto
        uint256 productId,
        Status status,
        string metadata,
        address author
    );

    mapping(uint256 => Step[]) public products; //va a relacionar el producto Id con cada uno de sus pasos, por eso Step es un array

    function registerProduct(uint256 productId) public returns (bool success) { //nos permite crear un nuevo producto
        require(products[productId].length == 0, "This product already exists"); //va a validar que este producto no tenga pasos asociados
        products[productId].push(Step(Status.CREATED, '')); //y luevo va a asignarle el paso con el estado 0
        return success; 
    }

    function registerStep(uint256 productId, string calldata metadata) public payable returns (bool success) {
        require(products[productId].length > 0, "This product doesn't exist"); // Va a validar que el producto exista
        Step[] memory stepsArray = products[productId]; // Va a tomar el array de pasos 
        uint256 currentStatus = uint256(stepsArray[stepsArray.length - 1].status) + 1; //y va a vaidar el estado del ultimo
        if (currentStatus > uint256(Status.DELIVERED)) { //validamos que este estado no sea mayor que el delivery, sino lanza error
            revert("The product has no more steps");
        }
        Step memory step = Step(Status(currentStatus), metadata); // asignamos el estado actual que hemos definido, el ultimo estado +1
        products[productId].push(step); //lo aÃ±adimos dentro de nuestro mapping al producto
        emit RegisteredStep(productId, Status(currentStatus), metadata, msg.sender);
        success = true;
    }
}

